            var name = entry.姓名;

            var longitude = parseFloat(entry.经度);
            var marker = L.marker([latitude, longitude]).addTo(map)
               .bindPopup('许可证号: ' + licenseNumber + '<br>姓名: ' + name);
            markers.push({
                licenseNumber: licenseNumber,
                name: name,
                marker: marker
            });
        });

        // 搜索功能
        document.getElementById('search-button').addEventListener('click', function() {
            var searchTerm = document.getElementById('search-input').value.toLowerCase();
            markers.forEach(function(entry) {
                if (entry.licenseNumber.toString().includes(searchTerm) || entry.name.toLowerCase().includes(searchTerm)) {
                    map.setView(entry.marker.getLatLng(), 15);
                    entry.marker.openPopup();
                }
            });
        });
    </script>

            var licenseNumber = entry.许可证号;
            var name = entry.姓名;
            var latitude = parseFloat(entry.纬度);
            var longitude = parseFloat(entry.经度);
            var marker = L.marker([latitude, longitude]).addTo(map)
               .bindPopup('许可证号: ' + licenseNumber + '<br>姓名: ' + name);
            markers.push({
                licenseNumber: licenseNumber,
                name: name,
                marker: marker
            });
        });

        // 搜索功能
        document.getElementById('search-button').addEventListener('click', function() {
            var searchTerm = document.getElementById('search-input').value.toLowerCase();
            markers.forEach(function(entry) {
                if (entry.licenseNumber.toString().includes(searchTerm) || entry.name.toLowerCase().includes(searchTerm)) {
                    map.setView(entry.marker.getLatLng(), 15);
                    entry.marker.openPopup();
                }
            });
        });

        data.forEach(function(entry) {
            var licenseNumber = entry.许可证号;
            var name = entry.姓名;
            var latitude = parseFloat(entry.纬度);
            var longitude = parseFloat(entry.经度);
            var marker = L.marker([latitude, longitude]).addTo(map)
               .bindPopup('许可证号: ' + licenseNumber + '<br>姓名: ' + name);
            markers.push({
                licenseNumber: licenseNumber,
                name: name,
                marker: marker
            });
        });

        // 搜索功能
        document.getElementById('search-button').addEventListener('click', function() {
            var searchTerm = document.getElementById('search-input').value.toLowerCase();
            markers.forEach(function(entry) {
                if (entry.licenseNumber.toString().includes(searchTerm) || entry.name.toLowerCase().includes(searchTerm)) {
                    map.setView(entry.marker.getLatLng(), 15);
                    entry.marker.openPopup();
                }
            });
        });
    </script>
